トランクオープナーレバー付車用<br>
材質：表面ポリプロピレン製、裏面SBS製<br>
足元にもおしゃれな心くばりを。日産純正のフロアカーペットは意匠登録出願済です。<br>
吸音効果や消臭機能も備えたフロアカーペットです。<br>
<br>
